// src/admin-pages/ManageNotes.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { FaTrash, FaEye, FaDownload, FaUniversity, FaBookOpen } from 'react-icons/fa';

const API = axios.create({
  baseURL: process.env.REACT_APP_API_BASE,
});

const ManageNotes = () => {
  const [notes, setNotes] = useState([]);

  const fetchNotes = async () => {
    try {
      const res = await API.get('/api/resources/notes');
      setNotes(res.data);
    } catch (err) {
      console.error('Failed to fetch notes:', err);
    }
  };

  useEffect(() => {
    fetchNotes();
  }, []);

  const handleDelete = async (id) => {
    if (!window.confirm('Are you sure you want to delete this note?')) return;
    try {
      await API.delete(`/api/resources/${id}`);
      alert('✅ Note deleted successfully.');
      fetchNotes();
    } catch (err) {
      console.error('❌ Delete failed:', err);
      alert('❌ Failed to delete note.');
    }
  };

  const handleView = (note) => {
    const fullUrl = `${process.env.REACT_APP_API_BASE}${note.fileUrl}`;
    window.open(fullUrl, '_blank', 'noopener,noreferrer');
  };

  const handleDownload = async (note) => {
    try {
      const downloadUrl = `${process.env.REACT_APP_API_BASE}/api/resources/download/${note._id}`;
      window.open(downloadUrl, '_blank', 'noopener,noreferrer');
    } catch (err) {
      console.error('❌ Download failed:', err);
      alert('❌ Failed to download note.');
    }
  };

  // Group by universityName
  const groupedNotes = notes.reduce((acc, note) => {
    const key = note.universityName;
    if (!acc[key]) acc[key] = [];
    acc[key].push(note);
    return acc;
  }, {});

  return (
    <div className="p-6 max-w-7xl mx-auto">
      <h2 className="text-4xl font-bold mb-8 text-blue-800 flex items-center gap-3">
        <FaBookOpen className="text-green-600" /> Manage Uploaded Notes
      </h2>

      {Object.entries(groupedNotes).length === 0 ? (
        <p className="text-gray-500">No notes available.</p>
      ) : (
        <div className="space-y-10">
          {Object.entries(groupedNotes).map(([universityName, notesInGroup]) => (
            <div key={universityName} className="bg-white rounded-xl shadow border p-6">
              <h3 className="text-2xl font-semibold text-blue-700 flex items-center gap-2">
                <FaUniversity className="text-purple-600" />
                {universityName}
              </h3>

              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mt-4">
                {notesInGroup.map((note) => (
                  <div key={note._id} className="bg-gray-50 rounded-lg p-4 shadow-sm border">
                    <h4 className="text-lg font-medium text-gray-800 mb-2">
                      {note.course} - Semester {note.semester}
                    </h4>
                    <p className="text-sm text-gray-500 mb-2">
                      <strong>Department:</strong> {note.department}
                    </p>

                    <div className="flex justify-between items-center mt-2">
                      <button
                        onClick={() => handleView(note)}
                        className="bg-blue-600 hover:bg-blue-700 text-white px-3 py-1 rounded flex items-center gap-1 text-sm"
                      >
                        <FaEye /> View
                      </button>

                      <button
                        onClick={() => handleDownload(note)}
                        className="bg-green-600 hover:bg-green-700 text-white px-3 py-1 rounded flex items-center gap-1 text-sm"
                      >
                        <FaDownload /> Download
                      </button>

                      <button
                        onClick={() => handleDelete(note._id)}
                        className="bg-red-600 hover:bg-red-700 text-white px-3 py-1 rounded flex items-center gap-1 text-sm"
                      >
                        <FaTrash /> Delete
                      </button>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default ManageNotes;
